import styled from "styled-components"

const Container = styled.div`
    height: 16px;
    background-color: teal;
    color: white,
`


const Announcement = () => {
  return (
    <Container>
      Super Deal! Free Shipping on Orders.
    </Container>
  )
}

export default Announcement
